s\":[\"190129__TA02TruantStudents\",\"TYT\",\"The Young Turks\",\"Cenk Uygur\",\"TYT Network\",\"John Iadarola\",\"Ana Kasparian\",\"kamala harris\",\"kamala harris town hall\",\"kamala harris speech\",\"kamala harris oakland\",\"kamala harris husband\",\"kamala harris iowa\",\"kamala harris district attorney\",\"kamala harris prosecutorial record\",\"kamala harris student truancy\",\"kamala harris district attorney san francisco\",\"kamala harris voting record\",\"kamala harris president\",\"kamala harris president announcement\"],\"channelId\":\"UC1yBKRuGpC1tSM73A0ZjYjQ\",\"isOwnerViewing\":false,\"shortDescription\":\"The cringeworthy video shows the Senator and presidential hopeful cackling at prosecuting parents over student truancy. Ana Kasparian and John Iadarola, hosts of The Young Turks, break it down. More TYT: https:\/\/go.tyt.com\/OIOednvLVCA\\n\\nRead more here: https:\/\/www.nbcbayarea.com\/news\/local\/San-Francisco-DA-Pushes-Parent-Punishment-61534042.html\\n\\n\\\"San Francisco high school students had better watch out: The city's district attorney is casting a wider net for kids who skip school.\\n\\nFor the last four years, District Attorney Kamala Harris has worked with the local school district to zero in on truant elementary and middle-school students and their parents. Her idea was that the adults responsible for the children should be the ones held accountable for their chronic absences and, after several warnings, would be prosecuted if they could not get their children to class.\\n\\nHarris and San Francisco Unified School District Superintendent Carlos Garcia announced today that the program has been expanded to include high school students. Select high school students who have been identified as chronically and habitually truant will be targeted for the initial monitoring and tracking of high school truancy cases and preliminary intervention.\\\"\\n\\n\\nHosts: Ana Kasparian, John Iadarola\\n\\nCast: Ana Kasparian, John Iadarola\\n\\n***\
